import V3Adapter from 'travis/adapters/v3';

export default V3Adapter.extend({
  pathPrefix(modelName, id, snapshot, type, query) {
    let prefix = 'v3';

    // Handle queries for organization settings
    if (type === 'query' && query.organization_id) {
      prefix += `/org/${query.organization_id}`;
      // Remove unnecessary query param from API call
      delete query.organization_id;
    }

    // Handle updates for organization settings
    if (type === 'updateRecord' &&
      (typeof snapshot.adapterOptions) !== 'undefined' &&
      snapshot.adapterOptions.hasOwnProperty('organization_id')
    ) {
      prefix += `/org/${snapshot.adapterOptions.organization_id}`;
    }

    return prefix;
  },

  ajax(url, method, ...rest) {
    if (method === 'PUT') method = 'PATCH';
    return this._super(url, method, ...rest);
  }
});

/* global TravisTracer, window */
/* eslint no-unused-vars: ["error", { "varsIgnorePattern": "config" }]*/

import { next } from '@ember/runloop';
import Component from '@ember/component';
import config from 'travis/config/environment';

export default Component.extend({
  tagName: 'div',
  panelIsOpen: false,
  config,

  init() {
    this._super(...arguments);

    if (window.localStorage.TravisTracerIsOpen) {
      this.panelIsOpen = true;
    }

    TravisTracer.onRequest = req => {
      this.requests.pushObject(req);
      this.ensurePanelScrolledToBottom();
    };
    this.requests = [];
  },

  actions: {
    toggleOpen() {
      this.toggleProperty('panelIsOpen');
      this.rememberPanelOpenState();
      this.ensurePanelScrolledToBottom();
    }
  },

  ensurePanelScrolledToBottom() {
    next(() => {
      let panel = document.getElementById('tracer-panel');
      panel.scrollTop = panel.scrollHeight + 20;
    });
  },

  rememberPanelOpenState() {
    if (this.panelIsOpen) {
      window.localStorage.TravisTracerIsOpen = 'true';
    } else {
      delete window.localStorage.TravisTracerIsOpen;
    }
  }
});

/* eslint no-unused-vars: ["error", { "varsIgnorePattern": "config" }]*/

import Controller from '@ember/controller';
import { computed } from '@ember/object';
import { filterBy, reads, none, not } from '@ember/object/computed';
import config from 'travis/config/environment';
import { inject as service } from '@ember/service';

export default Controller.extend({
  externalLinks: service(),
  features: service(),

  envVars: computed('unsortedEnvVars', function () {
    let envVars = this.unsortedEnvVars;
    return envVars.sortBy('name');
  }),

  config,

  unsortedEnvVars: filterBy('model.envVars', 'isNew', false),
  cronJobs: reads('model.repository.cronJobs'),

  showAutoCancellationSwitches: computed('model.settings', function () {
    let settings = this.get('model.settings');
    return settings.hasOwnProperty('auto_cancel_pushes')
      || settings.hasOwnProperty('auto_cancel_pull_requests');
  }),

  showAllowConfigImportsSwitch: computed('model.settings', 'repo.private', function () {
    let settings = this.get('model.settings');
    let isPrivate = this.get('repo.private');
    return isPrivate && settings.hasOwnProperty('allow_config_imports');
  }),

  showBetaFeatures: reads('showConfigValidationSwitches'),
  hasNoConfigValidation: none('model.settings.config_validation'),
  showConfigValidationSwitches: not('hasNoConfigValidation'),

  migratedRepositorySettingsLink: computed('repo.slug', function () {
    let slug = this.get('repo.slug');
    return this.externalLinks.migratedToComSettingsLink(slug);
  }),

  displaySettingsDisabledAfterMigrationModal: computed(
    'features.{proVersion,enterpriseVersion}',
    'repo.migrationStatus',
    function () {
      let pro = this.get('features.proVersion');
      let enterprise = this.get('features.enterpriseVersion');
      let migrationStatus = this.get('repo.migrationStatus');
      return !pro && !enterprise && ['migrating', 'migrated'].includes(migrationStatus);
    }
  ),

  actions: {
    sshKeyAdded(sshKey) {
      return this.set('model.customSshKey', sshKey);
    },

    sshKeyDeleted() {
      return this.set('model.customSshKey', null);
    }
  }
});

/* global window, XMLHttpRequest */

import config from 'travis/config/environment';

class Tracer {
  constructor() {
    this.requests = [];
  }

  enable() {
    window.localStorage['apiTrace'] = 'true';
  }

  disable() {
    delete window.localStorage['apiTrace'];
  }

  isEnabled() {
    return window.localStorage['apiTrace'] === 'true';
  }

  onRequest() {
  }

  install() {
    this.installXHR();
  }

  // xhr interceptor based on the symfony profiler
  installXHR() {
    let tracer = this;

    let proxied = XMLHttpRequest.prototype.open;
    XMLHttpRequest.prototype.open = function (method, url, async, user, pass) {
      let self = this;

      if (url.startsWith(config.apiEndpoint)) {
        let req = {
          loading: true,
          error: false,
          url: url.substr(config.apiEndpoint.length),
          method: method,
          start: new Date()
        };

        tracer.requests.push(req);

        this.addEventListener('readystatechange', () => {
          if (self.readyState == 4) {
            req.status = self.status;
            req.duration = new Date() - req.start;
            req.loading = false;
            req.error = self.status < 200 || self.status >= 400;
            req.requestId = self.getResponseHeader('X-Request-ID');
            req.requestIdShort = req.requestId ? req.requestId.substr(0, 8) : null;

            tracer.onRequest(req);
          }
        }, false);
      }

      proxied.call(this, ...arguments);

      if (url.startsWith(config.apiEndpoint)) {
        this.setRequestHeader('Trace', 'true');
      }
    };
  }

  bookmarklet() {
    if (this.isEnabled()) {
      this.disable();
    } else {
      this.enable();
    }
  }
}

export function initialize(app) {
  if (typeof window !== 'undefined') {
    window.TravisTracer = new Tracer();
    if (window.TravisTracer.isEnabled()) {
      window.TravisTracer.install();
      config.featureFlags.tracer = true;
    }
    return window.TravisTracer;
  }
}

export default {
  name: 'tracer',
  initialize,
};

import Model, { attr, belongsTo, hasMany } from '@ember-data/model';
import { inject as service } from '@ember/service';
import { computed } from '@ember/object';
import { alias, sort } from '@ember/object/computed';
import { isEmpty, isPresent } from '@ember/utils';
import { all } from 'rsvp';
import moment from 'moment';
import configKeysMap from 'travis/utils/keys-map';
import DurationCalculations from 'travis/mixins/duration-calculations';

export default Model.extend(DurationCalculations, {
  api: service(),

  branchName: alias('branch.name'),

  state: attr(),
  number: attr('number'),
  message: attr('string'),
  _duration: attr('number'),
  startedAt: attr('string'),
  finishedAt: attr('string'),
  pullRequestNumber: attr('number'),
  pullRequestTitle: attr('string'),
  tag: attr(),
  eventType: attr('string'),
  _config: attr(),
  updatedAt: attr('date'),

  repo: belongsTo('repo'),
  branch: belongsTo('branch', { async: false, inverse: 'builds' }),
  repoCurrentBuild: belongsTo('repo', { async: true, inverse: 'currentBuild' }),
  commit: belongsTo('commit', { async: false }),

  request: belongsTo('request', { async: true }),

  jobs: hasMany('job', { async: true }),
  stages: hasMany('stage', { async: true }),

  stagesSort: ['number'],
  sortedStages: sort('stages', 'stagesSort'),

  createdBy: belongsTo('user'),

  stagesAreLoaded: alias('stages.isSettled'),

  config: computed('_config', 'currentState.stateName', function () {
    let config = this._config;
    let stateName = this.get('currentState.stateName');

    if (config) {
      return Object.keys(config).reduce((compact, key) => {
        const value = config[key];
        if (isPresent(value)) compact[key] = value;
        return compact;
      });
    } else if (stateName !== 'root.loading') {
      if (this.isFetchingConfig) {
        return;
      }
      this.set('isFetchingConfig', true);
      return this.reload();
    }
  }),

  isPullRequest: computed('eventType', function () {
    let eventType = this.eventType;
    return eventType === 'pull_request';
  }),

  isMatrix: computed('jobs.[]', function () {
    let jobs = this.jobs;
    return jobs.get('length') > 1;
  }),

  isTag: computed('tag', function () {
    let tag = this.tag;
    return (tag && tag.name);
  }),

  isFinished: computed('state', function () {
    let state = this.state;
    let finishedStates = ['passed', 'failed', 'errored', 'canceled'];
    return finishedStates.includes(state);
  }),

  notStarted: computed('state', function () {
    let state = this.state;
    let waitingStates = ['queued', 'created', 'received'];
    return waitingStates.includes(state);
  }),

  requiredJobs: computed('jobs.@each.allowFailure', function () {
    let jobs = this.jobs;
    return jobs.filter(job => !job.get('allowFailure'));
  }),

  allowedFailureJobs: computed('jobs.@each.allowFailure', function () {
    let jobs = this.jobs;
    return jobs.filter(job => job.get('allowFailure'));
  }),

  rawConfigKeys: computed('jobs.@each.config', function () {
    let jobs = this.jobs;
    const keys = [];
    jobs.forEach(job => {
      const configKeys = job.config || [];
      return configKeys.forEach(key => {
        if (!keys.includes(key) && configKeysMap.hasOwnProperty(key)) {
          return keys.pushObject(key);
        }
      });
    });
    return keys;
  }),

  configKeys: computed('rawConfigKeys.[]', function () {
    let keys = this.rawConfigKeys;
    const headers = ['Job', 'Duration', 'Finished'];
    return headers.concat(keys).map((key) => {
      if (configKeysMap.hasOwnProperty(key)) {
        return configKeysMap[key];
      } else {
        return key;
      }
    });
  }),

  canCancel: computed('jobs.@each.canCancel', function () {
    let jobs = this.jobs;
    return !isEmpty(jobs.filterBy('canCancel'));
  }),

  canRestart: alias('isFinished'),

  cancel() {
    const url = `/build/${this.id}/cancel`;
    return this.api.post(url);
  },

  restart() {
    const url = `/build/${this.id}/restart`;
    return this.api.post(url);
  },

  canDebug: computed('jobs.[]', 'repo.private', function () {
    let jobs = this.jobs;
    let repoPrivate = this.get('repo.private');
    return jobs.get('length') === 1 && repoPrivate;
  }),

  debug() {
    return all(this.jobs.map(job => job.debug()));
  },

  formattedFinishedAt: computed('finishedAt', function () {
    let finishedAt = this.finishedAt;
    if (finishedAt) {
      let m = moment(finishedAt);
      return m.isValid() ? m.format('lll') : 'not finished yet';
    }
  }),
});

import BuildV2FallbackSerializer from 'travis/serializers/build_v2_fallback';

export default BuildV2FallbackSerializer.extend({
  attrs: {
    _config: { key: 'config' },
    _duration: { key: 'duration' }
  },

  keyForRelationship(key/* , typeClass, method*/) {
    if (key === 'repo') {
      return 'repository';
    } else {
      return this._super(...arguments);
    }
  },

  normalize: function (modelClass, resourceHash) {
    if (resourceHash['event_type'] == 'pull_request' &&
          !resourceHash.hasOwnProperty('pull_request')) {
      // in V3 we don't return "pull_request" property as we rely on event_type
      // value. This line makes V3 payloads also populate pull_request property
      resourceHash['pull_request'] = true;
    }

    return this._super(modelClass, resourceHash);
  }
});

import V2FallbackSerializer from 'travis/serializers/v2_fallback';

export default V2FallbackSerializer.extend({
  normalizeSingleResponse: function (store, primaryModelClass, payload/* , id, requestType*/) {
    if (!payload['@type'] && payload.commit) {
      payload.build.commit = payload.commit;
      delete payload.build.commit_id;
    }
    return this._super(...arguments);
  },

  normalizeArrayResponse: function (store, primaryModelClass, payload/* , id, requestType*/) {
    if (payload.commits) {
      payload.builds.forEach((build) => {
        let commit = payload.commits.findBy('id', build.commit_id);
        if (commit) {
          build.commit = commit;
          return delete build.commit_id;
        }
      });
    }
    return this._super(...arguments);
  },

  keyForV2Relationship: function (key/* , typeClass, method*/) {
    if (key === 'jobs') {
      return 'job_ids';
    } else if (key === 'repo') {
      return 'repository_id';
    } else if (key === 'commit') {
      return key;
    } else {
      return this._super(...arguments);
    }
  },

  normalize: function (modelClass, resourceHash) {
    // TODO: remove this after switching to V3 entirely
    let type = resourceHash['@type'];
    let commit = resourceHash.commit;
    if (!type && commit && commit.hasOwnProperty('branch_is_default')) {
      let build = resourceHash.build,
        commit = resourceHash.commit;
      let branch = {
        name: commit.branch,
        default_branch: commit.branch_is_default,
        '@href': `/repo/${build.repository_id}/branch/${commit.branch}`
      };
      resourceHash.build.branch = branch;
    }

    // fix pusher payload, it doesn't include a branch record:
    if (!type && resourceHash.build &&
       resourceHash.repository && resourceHash.repository.default_branch) {
      let branchName = resourceHash.commit.branch,
        repository = resourceHash.repository,
        defaultBranchName = repository.default_branch.name;

      resourceHash.build.branch = {
        name: branchName,
        default_branch: branchName === defaultBranchName,
        '@href': `/repo/${repository.id}/branch/${branchName}`
      };

      repository.default_branch['@href'] = `/repo/${repository.id}/branch/${defaultBranchName}`;
    }

    return this._super(modelClass, resourceHash);
  }
});

import Service, { inject as service } from '@ember/service';
import moment from 'moment';
import { assign } from '@ember/polyfills';
import { task } from 'ember-concurrency';
import { singularize } from 'ember-inflector';

export const INSIGHTS_INTERVALS = {
  WEEK: 'week',
  MONTH: 'month',
};
export const DEFAULT_INSIGHTS_INTERVAL = INSIGHTS_INTERVALS.MONTH;

const defaultIntervalSettings = {
  day: {
    subInterval: '10min',
    instanceLabel: 'today',
    prevInstanceLabel: 'yesterday',
  },
  week: {
    subInterval: '1day',
    instanceLabel: 'this week',
    prevInstanceLabel: 'last week',
  },
  month: {
    subInterval: '1day',
    instanceLabel: 'this month',
    prevInstanceLabel: 'last month',
  },
};

const defaultOptions = {
  intervalSettings: {},
  calcAvg: false,
  private: false,
};

const apiTimeBaseFormat = 'YYYY-MM-DD HH:mm:ss';
const apiTimeRequestFormat = `${apiTimeBaseFormat} UTC`;
const apiTimeReceivedFormat = `${apiTimeBaseFormat} zz`;

const baseEndpoint = '/insights';
const endpoints = {
  metrics: `${baseEndpoint}/metrics`,
  activeRepos: `${baseEndpoint}/repos/active`
};

export default Service.extend({
  api: service(),
  raven: service(),
  flashes: service(),

  getIntervalSettings(customIntervalSettings = {}) {
    // Merge and assign, I don't think do deep merges, but interval settings is only ever 2 levels
    // deep so all we need to do is loop through each interval and do a shallow merge
    const settings =  Object.values(INSIGHTS_INTERVALS).reduce((settings, interval) => {
      settings[interval] = {};
      assign(settings[interval], defaultIntervalSettings[interval], customIntervalSettings[interval]);
      return settings;
    }, {});
    return settings;
  },

  // In this context, a negative value for startInterval or endInterval indicates a date in the past. Think of it as the number of `interval`s
  // that should be added to the current date to arrive at the start/end of the time period you would like to look at.
  getDatesFromInterval(interval, startInterval = -1, endInterval = 0) {
    const startIntervalDays = convertIntervalToDays(interval, startInterval);
    const endIntervalDays = convertIntervalToDays(interval, endInterval);

    let start = moment.utc().add(startIntervalDays, 'day');
    let end = moment.utc().add(endIntervalDays, 'day');

    if (interval === 'day') {
      start = start.startOf('hour');
    } else {
      start = start.add(1, 'day').startOf('day');
    }

    return [start, end];
  },

  getChartData: task(function* (owner, interval, subject, func, metricNames = [], options = {}) {
    /* Prepare for API request to fetch metrics */
    const currentOptions = mergeMetricSettings(options, func);
    const intervalSettings = this.getIntervalSettings(currentOptions.intervalSettings);
    const { subInterval } = intervalSettings[interval];
    const { startInterval, endInterval, aggregator } = currentOptions;
    const [startTime, endTime] = this.getDatesFromInterval(interval, startInterval, endInterval);
    const apiSettings = getMetricAPISettings(subject, func, subInterval, metricNames, owner, startTime, endTime, currentOptions);

    /* Fetch metrics */
    let metrics = yield this.fetchMetrics.perform(apiSettings, currentOptions);
    const requestPrivate = metrics.data.private === 'true';

    /* Set labels */
    let labels = createLabels(startTime, endTime, subInterval);

    /* Prepare fetched metric data for charts */
    let data = aggregateMetrics(metricNames, metrics, aggregator, labels, subInterval);

    serializeMetrics(data, metricNames, currentOptions);

    labels = Object.keys(labels);

    return { data, private: requestPrivate, labels, metrics };
  }),

  fetchMetrics: task(function* (apiSettings) {
    return yield this.api.get(endpoints.metrics, apiSettings) || [];
  }),

  // Active Repo endpoint functions
  getActiveRepos(owner, interval, requestPrivate = false) {
    const [startTime, endTime] = this.getDatesFromInterval(interval);

    const apiSettings = {
      stringifyData: false,
      data: {
        owner_type: owner.isUser ? 'User' : 'Organization',
        owner_id: owner.id,
        end_time: endTime.format(apiTimeRequestFormat),
        start_time: startTime.format(apiTimeRequestFormat),
        private: requestPrivate,
      }
    };

    return this.fetchActiveRepos.perform(apiSettings);
  },

  fetchActiveRepos: task(function* (apiSettings) {
    return yield this.api.get(endpoints.activeRepos, apiSettings) || [];
  }),
});

// Metric preparation functions
function getMetricAPISettings(subject, func, subInterval, metricNames, owner, startTime, endTime, options) {
  return {
    stringifyData: false,
    data: {
      subject,
      interval: subInterval,
      func,
      name: metricNames.join(','),
      owner_type: owner.isUser ? 'User' : 'Organization',
      owner_id: owner.id,
      end_time: endTime.format(apiTimeRequestFormat),
      start_time: startTime.format(apiTimeRequestFormat),
      private: options.private,
    },
  };
}

function mergeMetricSettings(options, func) {
  const currentOptions = assign({}, defaultOptions, options);
  currentOptions.aggregator = currentOptions.aggregator || func;
  currentOptions.serializer = currentOptions.serializer || func;
  return currentOptions;
}

// Currently, when displaying insights, we regard a "month" as a period of 30 days and a "week" as a period of 7 days.
function convertIntervalToDays(interval, amount) {
  return {
    month: 30 * amount,
    week: 7 * amount,
    day: amount,
  }[interval];
}

function getSubintervalDetails(subInterval) {
  return {
    '1min': {step: 1, intervalName: 'minutes', keyFormat: 'YYYY-MM-DD HH:mm'},
    '10min': {step: 10, intervalName: 'minutes', keyFormat: 'YYYY-MM-DD HH:mm'},
    '1hour': {step: 1, intervalName: 'hours', keyFormat: 'YYYY-MM-DD HH'},
    '1day': {step: 1, intervalName: 'days', keyFormat: 'YYYY-MM-DD'},
  }[subInterval];
}

function createLabels(startTime, endTime, subInterval) {
  const labels = {};
  let { step, intervalName } = getSubintervalDetails(subInterval);

  let current = moment.utc(startTime).startOf(singularize(intervalName));
  if (step !== 1) {
    let units = current[intervalName]();
    let remainder = units % step;
    current[intervalName](units - remainder);
  }

  while (current < endTime) {
    labels[formatTimeKey(current, subInterval)] = 0;
    current.add(step, intervalName);
  }

  return labels;
}

function formatTimeKey(time, subInterval) {
  const { keyFormat } = getSubintervalDetails(subInterval);
  return moment.utc(time).format(keyFormat);
}

function aggregateMetrics(metricNames, metrics, aggregatorName, labels, subInterval) {
  const defaultData = metricNames.reduce((map, metric) => {
    map[metric] = assign({}, labels);
    return map;
  }, {});

  // Aggregate metric data
  const aggregator = getAggregator(aggregatorName);

  // Data aggregation
  let aggData = metrics.data.values.reduce((timesMap, { value, time, name }) => {
    // Continue is value is invalid
    if (typeof value !== 'number' || Number.isNaN(value)) { return timesMap; }

    // Create key for map from time
    const timeKey = formatTimeKey(moment.utc(time, apiTimeReceivedFormat), subInterval);

    // Aggregate and continue building map
    timesMap = aggregator(timesMap, name, timeKey, value);
    return timesMap;
  }, defaultData);

  return aggData;
}

function serializeMetrics(serData, metricNames, currentOptions) {
  const serializer = getSerializer(currentOptions.serializer);
  let total = 0, avgs = [];

  // Loop through each metric
  metricNames.map((metricName) => {
    let currentMetric = serData[metricName];

    // Run serializer on each data point
    let plotData = Object.entries(currentMetric).map(([key, val]) => {
      // Run chosen serializer
      let [newKey, newVal] = serializer(key, val);

      // Run additional custom serializer if relevant
      if (typeof currentOptions.customSerialize === 'function') {
        try { [newKey, newVal] = currentOptions.customSerialize(newKey, newVal); } catch (e) {}
      }

      return [newKey, newVal];
    });
    currentMetric.plotData = plotData;

    // Split into labels and values - works better for some charting libraries
    currentMetric.plotLabels = currentMetric.plotData.map(([key, val]) => key);
    currentMetric.plotValues = currentMetric.plotData.map(([key, val]) => val);

    // Calculate total
    currentMetric.total = currentMetric.plotValues.reduce((acc, val) => acc + val, 0);
    total += currentMetric.total;

    // Calculate average if requested. Uses total calculated above.
    if (currentOptions.calcAvg) {
      const filtered = currentMetric.plotValues.filter(v => v !== 0);
      currentMetric.average = filtered.length === 0 ? 0 : currentMetric.total / filtered.length;
      avgs.push(currentMetric.average);
    }
  });

  // Calculate grand total / average of all metrics
  serData.total = total;
  if (currentOptions.calcAvg) {
    let avgsTotal = avgs.reduce((a, v) => a + v, 0);
    serData.average = avgs.length === 0 ? 0 : avgsTotal / avgs.length;
  }

  return serData;
}

// These aggregator functions are for aggregating data when there is a key collision, i.e. when
// there are multiple values for a given time. This happens on the owner page because repos are
// the main thing that the insights app aggregates data around
function getAggregator(aggName) {
  return {
    sum: sumAggregator,
    max: maxAggregator,
    avg: avgAggregator,
    count: countAggregator,
  }[aggName];
}

function sumAggregator(map, name, time, value) {
  if (map[name].hasOwnProperty(time)) {
    map[name][time] += value;
  } else {
    map[name][time] = value;
  }
  return map;
}

function maxAggregator(map, name, time, value) {
  if (map[name].hasOwnProperty(time)) {
    if (value > map[name][time]) {
      map[name][time] = value;
    }
  } else {
    map[name][time] = value;
  }
  return map;
}

function avgAggregator(map, name, time, value) {
  if (map[name].hasOwnProperty(time) && typeof map[name][time] !== 'number') {
    map[name][time][0]++;
    map[name][time][1] += value;
  } else {
    map[name][time] = [1, value];
  }
  return map;
}

function countAggregator(map, name, time, value) {
  if (map[name].hasOwnProperty(time)) {
    map[name][time]++;
  } else {
    map[name][time] = 1;
  }
  return map;
}

// These serializer functions are for putting point data into a format to be read by the
// charting components
function getSerializer(serializerName) {
  const serializers = {
    avg: avgSerializer,
  };
  return serializers[serializerName] || defaultSerializer;
}

function avgSerializer(key, val) {
  let newVal = val === 0 || val[0] === 0 ? 0 : (val[1] / val[0]);
  return [key, newVal];
}

function defaultSerializer(key, val) {
  return [key, val];
}

/* eslint-disable camelcase */
import Store from 'ember-data/store';
import PaginatedCollectionPromise from 'travis/utils/paginated-collection-promise';
import { inject as service } from '@ember/service';
import FilteredArrayManager from 'travis/utils/filtered-array-manager';
